from pybricks.hubs import PrimeHub
from pybricks.parameters import Direction, Port, Stop
from pybricks.pupdevices import Motor
from pybricks.robotics import DriveBase
from pybricks.tools import wait

# Set up all devices.
prime_hub = PrimeHub()
motor = Motor(Port.A, Direction.CLOCKWISE)
motor2 = Motor(Port.B, Direction.COUNTERCLOCKWISE)
front = Motor(Port.E, Direction.COUNTERCLOCKWISE)
back = Motor(Port.F, Direction.CLOCKWISE)
drive_base = DriveBase(motor2, motor, 81.6, 101.7)

def Run_5():
    drive_base.curve(150, 86)
    drive_base.settings(straight_speed=550)
    drive_base.straight(565)
    drive_base.turn(48)
    drive_base.settings(straight_speed=300)
    drive_base.straight(222)
    # finished feeding the fish
    wait(250)
    drive_base.settings(straight_speed=550)
    drive_base.straight(-240)
    drive_base.turn(65)
    # -444 change to -470
    drive_base.straight(-470)
    # about to turn towards submersible
    drive_base.turn(26)
    # Regular case (tower in the back).  about to run towards submersible
    drive_base.straight(-35)
    back.run_angle(500, -360)
    back.run_angle(500, 360)
    # after chicken submarine was invaded 40, -30
    drive_base.straight(43)
    drive_base.turn(-25)
    # run towards auv stand 200-190
    drive_base.straight(190)
    drive_base.turn(-30)
    drive_base.straight(-320)
    drive_base.turn(-40)
    drive_base.straight(-225)
    back.run_angle(500, -320)
    wait(500)
    drive_base.settings(straight_speed=800)
    drive_base.straight(250)
    drive_base.turn(-25)
    drive_base.straight(-230)
    drive_base.turn(20)


# The main program starts here.
drive_base.use_gyro(True)
print('voltage is', prime_hub.battery.voltage())
print('MA is', prime_hub.battery.current())
Run_5()
